'''Gnome Waiters''' run the shop [[Gianne's Restaurant]] that sells premade [[Gnome cooking|gnome cuisine]], such as [[Gnome cooking#Crunchies|crunchies]], [[Gnome cooking#Battas|battas]] and [[Gnome cooking#Gnomebowls|gnomebowls]]. The food they sell cannot be used in the [[Gnome Restaurant]] minigame. They are located on the {{FloorNumber|uk=1}} of the [[Grand Tree]] north of the bank.

They seem to be sad about the food being made by a human assistant chef, as it was not up to the Chef's exacting standards, and claims the food may not be accepted as the 'real' thing.

